import React from 'react';
// import Home from './components/Home'
import { Header, Container, Segment } from 'semantic-ui-react'
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";

import './App.css';
import Presentation from './components/presentation';

function App() {
  return (
    <Router>
      <div>
        <Container>
          <Header className='home' textAlign='justified'>
            <Link to='/collaborateur'><Segment size='big' textAlign='center'>Collaborateur</Segment></Link>
            <Segment size='big' textAlign='center'>RH</Segment>
          </Header>
        </Container>
        <Switch>
          <Route path='/collaborateur'><Presentation /></Route>
        </Switch>
      </div>
    </Router>
  );
}

export default App;
